const Footer = () => (

  <section class="footor bg-dark text-white">
    <br/>
    <p class="lead container"><a href="https://github.com/ShravesChinta/MM802-BlockChain-NFT-Project">Github Repo</a></p>
    <p class="lead container"><a href="#">Survey Link</a></p>
    <p class="lead container"><a href="#">Report Link</a></p>
    <br/>
  </section>
);

export default Footer;
